import React from 'react';
import {Slider} from 'react';

const MySlider = () => {
    return (
        <div className="slider">
            <Slider
                size="small"
                defaultValue={70}
                aria-label="Small"
                valueLabelDisplay="auto"
                />
            <Slider defaultValue={50} aria-label="Default" valueLabelDisplay="auto" />
        </div>
    );
}
 
export default MySlider;
